class Results extends React.Component {

    constructor(props) {
        super(props);
        this.deleteNote = this.deleteNote.bind(this)
    }

    deleteNote = async (e) => {
        //e.preventDefault();
        console.log("!!!!delete ", this);

        /*
                const api_url = await fetch(`http://127.0.0.1:8080/message/1`,
                    {
